import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import lamp_on from "./images/lamp_on.png";
import lamp_off from "./images/lamp_off.png";

function App() {
    return (
        <div className="content">
            <div className="container">
                <div className="row justify-content-between">
                    <div className="col-auto">
                        Device 1
                        <img src={lamp_off} alt="Device 1" />
                    </div>
                    <div className="col-auto">
                        Device 2
                        <img src={lamp_off} alt="Device 2" />
                    </div>
                </div>
            </div>
        </div>
    );
}

export default App;
